import React from "react";
import ContactCard from "./ContactCard";

const ContactList = (props) => {


    const getKey = (para) =>{
        props.passKey(para);
    }

    const contacts = {
        name:"madanmohan",
        id:1,
        email:"madanmohan@vrindavan.com",
        location:"aditya tila",
    }


    const renderContacts = props.contacts.map((x) => {
        return(
            <ContactCard elem={x} passKey={getKey}/>
        );
    });
    return(
        <div className="ui celled list">
           {renderContacts}
        </div>
    );


}

export default ContactList;
